import React, { useEffect, useState } from "react";
import "./RegFormOne.css";
import { TextInput } from "../TextInput/TextInput";

interface FormOneState {
  firstName: string;
  lastName: string;
  email: string;
  dateOfBirth: string;
}

export const RegFormOne: React.FC = () => {
  const [stepOneState, setStepOneState] = useState<FormOneState>({
    firstName: "",
    lastName: "",
    email: "",
    dateOfBirth: "",
  });

  const updateUser = (e: React.ChangeEvent<HTMLInputElement>): void => {
    setStepOneState({ ...stepOneState, [e.target.name]: e.target.value });
  };

  // useEffect(() => {
  //   console.log("State change: ", stepOneState); lo
  // }, [stepOneState]);

  return (
    <div className="reg-step-one-container">
      <div className="reg-step-one-content">
        <TextInput
          name="firstName"
          label="First Name"
          errorMessage="Please enter your first name"
          onChange={updateUser}
        />
        <TextInput
          name="lastName"
          label="Last Name"
          errorMessage="Please enter your last name"
          onChange={updateUser}
        />
        <TextInput
          name="email"
          label="Email"
          errorMessage="Please enter a valid email address"
          onChange={updateUser}
        />
      </div>
    </div>
  );
};
